import React from 'react';
import {Text, View, StyleSheet, Image} from 'react-native';

const SquareCounter = props => {

    return (
        <View>
            <Text>Colour - {props.color}</Text>
        </View>
    )
}

const styles = StyleSheet.create({
    textStyle: {
        fontSize: 30
    }
})

export default SquareCounter;
